import React from "react";
import IntroduceText from "../../components/IntroduceText";

import Page from "../../components/Page";

function Guide() {
  return (
    <Page title="ABOUT US">
      <Grid
        container
        spacing={2}
        justifyContent="center"
        alignItems="center"
        mt={3}
      >
        <IntroduceText
          firstLine="BANTO STATION"
          secondLine="사용 및 설치 방법"
        />
      </Grid>
    </Page>
  );
}

export default Guide;
